import React from "react";
import "./footer";

const footer = () => {
  return (
    <section id="footer">
      <div className="contactUs">
        <ul>
          <li>Instagram</li>
          <li>Twitter</li>
          <li>Twitch</li>
        </ul>
      </div>
      <div className="copyright">
        <p>copyright by me @2021</p>
      </div>
      <div className="media">
        <ul>
          <li>Instagram</li>
          <li>Twitter</li>
          <li>Twitch</li>
        </ul>
      </div>
    </section>
  );
};

export default footer;
